import { Link } from "react-router-dom";

const headerBrandListing = ({ brands }) => {
    return (
        <>
            <ul className="dropList active">
                {
                    brands.map(( brand ) => {
                        return <li key={brand.id}><Link>{brand.title}</Link></li>
                    })
                }

                <li><Link>Xotic Labs</Link></li>
                <li><Link>Dragon Ball Z</Link></li>
                <li><Link>Action Again</Link></li>
            </ul>
        </>
    )
}

export default headerBrandListing
